import Layout from "../components/Layout";
import Link from "next/link";

// Add Post
const getPosts = () => [
  {
    id: "self-taught-challenges",
    title: "Challenges of a Self-Taught Developer"
  },
  { id: "loops", title: "Looping through objects" },
  { id: "reflections", title: "Current Reflections" },
  { id: "reflections", title: "Current Reflections" }
];

// PostLink Component
const PostLink = ({ post }) => (
  <>
    <Link href="/p/[title]" as={`/p/${post.title}`}>
      <a className="nav-link">{post.title}</a>
    </Link>
    <style jsx>
      {`
        .nav-link {
          text-decoration: none;
        }
      `}
    </style>
  </>
);

export default function Blog() {
  return (
    <Layout>
      <div className="layout">
        <h1>Tech_Blog</h1>
        <h2>Posts</h2>
        <section>
          <ul>
            {getPosts().map(post => (
              <li className="post" key={post.id}>
                <PostLink key={post.id} post={post} />
              </li>
            ))}
          </ul>
        </section>
      </div>
      <style jsx>
        {`
          h1 {
            font-size: 50px;
            margin-bottom: 50px;
          }
          h2 {
            font-family: Montserrat;
            margin-bottom: 10px;
            font-size: 40px;
            font-weight: 400;
          }
          .layout {
            padding-top: 50px;
            padding-left: 100px;
            line-height: 1.5;
            background-color: SeaShell;
          }
          .nav-link {
            text-decoration: none;
          }
          .post {
            display: flex-box;
            width: 800px;
            background-color: white;
            padding: 40px;
            margin-bottom: 10px;
            border-radius: 10px;
          }
        `}
      </style>
    </Layout>
  );
}
